import { useState, useEffect } from "react";
import CourseList from './CourseList'

const Home = ()=>{

    // Reactive Variables

    const [courses, setCourses] = useState(null);
    
    // UseEffect Hook

    useEffect(()=>{
        fetch('http://localhost:3000/api/getCourses')
        .then(res  => {
            console.log(res);
            return res.json();
        })
        .then((data)=>{
            setCourses(data);
        })
        .catch(err =>{
            console.log(err.message);
        })
    },[]);
    return (
        <div className="Home">
            <h2>My Courses</h2>
            {courses && <CourseList courses = {courses}></CourseList>}
        </div>
    );
}

export default Home;
